import React, { useCallback, useEffect, useState } from 'react';
import axios from 'axios';
import { Header } from '../component/Header';
import { Sidebar } from '../component/Sidebar';
import { useAuth } from '../context/auth';

const PeminjamanUser = () => {
    const { token, logout, isLogin, isRole } = useAuth();
    const [user, setUser] = useState('');
    const [borrow, setBorrow] = useState([]);
    const [error, setError] = useState(null);

    const fetchUser = useCallback(async () => {
        try {
            const response = await axios.get("http://localhost:5000/api/user", {
                headers: { Authorization: `Bearer ${token}` },
            });
            setUser(response.data);
        } catch (error) {
            setError(error.message);
        }
    }, [token]);

    const fetchBorrow = useCallback(async () => {
        try {
            const response = await axios.get("http://localhost:5000/api/borrow", {
                headers: { Authorization: `Bearer ${token}` },
            });
            setBorrow(response.data);
        } catch (error) {
            setError(error.message);
        }
    }, [token]);

    useEffect(() => {
        fetchUser();
        fetchBorrow();
    }, [fetchUser, fetchBorrow]);

    return (
        <div className='flex flow-row'>
            <Sidebar />
            <div className='flex flex-col flex-1 bg-gray-50 overflow-y-auto'>
                <Header user={user} logout={logout} />
                <div className='m-6 bg-white max-w-full h-full rounded-lg shadow-md'>
                    {borrow.length > 0 ? (
                        <table className="min-w-full divide-y divide-gray-200">
                            <thead className="bg-gray-50">
                                <tr>
                                    <th className="px-6 py-3 text-xs font-medium text-gray-500 uppercase tracking-wider">
                                        ID
                                    </th>
                                    <th className="px-6 py-3 text-xs font-medium text-gray-500 uppercase tracking-wider">
                                        Nama
                                    </th>
                                    <th className="px-6 py-3 text-xs font-medium text-gray-500 uppercase tracking-wider">
                                        Judul Buku
                                    </th>
                                    <th className="px-6 py-3 text-xs font-medium text-gray-500 uppercase tracking-wider">
                                        Tanggal Pinjam
                                    </th>
                                    <th className="px-6 py-3 text-xs font-medium text-gray-500 uppercase tracking-wider">
                                        Tanggal Kembali
                                    </th>
                                    <th className="px-6 py-3 text-xs font-medium text-gray-500 uppercase tracking-wider">
                                        Tanggal Kembali
                                    </th>
                                </tr>
                            </thead>
                            <tbody className="bg-white divide-y divide-gray-200">
                                {borrow.map((borrows) => (
                                    <tr key={borrows.id}>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            <div className="text-sm text-gray-900">{borrows.PeminjamanID}</div>
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            <div className="text-sm text-gray-900">{borrows.UserID}</div>
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            <div className="text-sm text-gray-900">{borrows.BukuID}</div>
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            <div className="text-sm text-gray-900">{borrows.TanggalPeminjaman}</div>
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            <div className="text-sm text-gray-900">{borrows.TanggalPengembalian}</div>
                                        </td>
                                        <td className="px-6 py-4 whitespace-nowrap">
                                            <div className="text-sm text-gray-900">{borrows.StatusPeminjaman}</div>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    ) : (
                        <div className="text-center text-gray-600 p-10">
                            Belum ada data peminjaman
                        </div>
                    )}
                </div>
            </div>
        </div>
    );
};

export default PeminjamanUser;
